import fetch from "node-fetch";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function Employetab() {
  const [data, setData] = useState("");
  useEffect(() => {
    fetch("http://localhost:3006/employesdata")
      .then((res) => {
        return res.json();
      })
      .then((resp) => {
        console.log(resp);
      })
      .catch((err) => {
        console.log(err.message);
      });
  });

  return (
    <div>
      <div className="card">
        <div className="title">
          <h2>Employe Mangement System</h2>
        </div>
        <Link to="Empform" type="button" class="btn btn-primary p-2 g-col-1">
          Add Nem(+)
        </Link>
        <div class="p-2 g-col-6">Grid item 1</div>

        <div className="card-body">
          <table className="table table-bordered">
            <thead className="bg-dark text-white">
              <tr>
                <th>id</th>
                <th>name</th>
                <th>email</th>
                <th>mobile</th>
              </tr>
            </thead>
            <tbody>
              {data &&
                data.map((item) => (
                  <tr>
                    <td> {item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td>{item.mobile}</td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
export default Employetab;
